import React from 'react'
import './Book.css'

const Book = () => {
  return (
    <div id='container-data'>
      <span id='id-container1' className='book-data'>id</span>
      <span id='container-data2' className='book-data'>title</span>
      <span className='book-data'>author</span>
      <span className='book-data'>price</span>
    </div>
  )
}

export default Book
